import React from "react";
import '../stylesheets/Final.css';

const FooterClient = () => {
  return (
    <footer style={{ backgroundColor: "#f8fafc", textAlign: "center", padding: "1rem", marginTop: "auto" }}>
      <p>&copy; 2025 YourPlatform. All rights reserved.</p>
    </footer>
  );
};

export default FooterClient;
